import {Link} from "react-router-dom";
const Header = () => {
  return (
    <header>
        <a href="" className="logo">
          MyBlog
        </a>
        <nav>
          <Link href="/login">Login</Link>
          <a href="">Register</a>
        </nav>
      </header>
  )
}
export default Header
